import { Charg_Three, En_Hero, Middle } from "../comps/Portal";
import { homeCharging } from "../constants";

const Home_Charging = () => {
  return (
    <>
      <En_Hero
        prod={homeCharging}
        title="Home Charging"
        customLinkLabel="Shop Now"
        get="/"
      />
      <Charg_Three thing={homeCharging.ways} />
      <Middle_Image
        topic="Convenience"
        title={commercial.storage.title}
        describe={commercial.storage.describe}
        cover={commercial.storage.cover}
        contact
      />
      <Middle_Image
        topic="Installation"
        title={commercial.storage.title}
        describe={commercial.storage.describe}
        cover={commercial.storage.cover}
        contact
      />
      <Middle_Image
        topic="Cost of Ownership"
        title={commercial.storage.title}
        describe={commercial.storage.describe}
        cover={commercial.storage.cover}
        contact
      />
    </>
  );
};

export default Home_Charging;
